### Summary of Core Topics and Concepts

#### 1. **Linux Shell Basics**
- **Directory and File Operations**
  - `mkdir`: Create directories.
  - `touch`: Create files.
  - `rmdir`: Remove directories.
  - `rm`: Remove files.
  - `ls`: List directory contents.
  - `ln`: Create links between files.
  - `stat`: Display file or filesystem status.
  - `file`: Determine file type.
  - `cut`: Remove sections from each line of files.
  - `grep`: Print lines that match patterns.
  - `tail`: Output the last part of files.
  - `cat`: Concatenate files and print on the standard output.
  - `wc`: Print newline, word, and byte counts for each file.
  - `chmod`: Change file mode bits.
  - `ssh-keygen`: Generate, manage, and convert authentication keys for SSH.
  - `ssh`: OpenSSH remote login client.
  - `echo`: Display a line of text.
  - `vi` and `emacs`: Text editors.
  - `grep`: Search text using patterns.
  - `sha1sum`: Compute and check SHA1 message digest.
  - `command &`: Run a command in the background.
  - `command > output.txt 2>&1`: Redirect stdout and stderr to a file.
  - `inode`: Unique identifier for a file in a filesystem.

#### 2. **SSH and Permissions**
- **SSH Key Management**
  - `ssh-keygen -t rsa -b 3072 -f ~/.ssh/id_rsa`: Generate an RSA key with 3072 bits.
  - `chmod 600 ~/.ssh/id_rsa`: Set correct permissions for the SSH key file.
  - `ssh-keygen -R remote-vm`: Remove all keys belonging to the specified hostname from a known_hosts file.
  - `ssh-keygen -f ~/.ssh/id_rsa -y`: Display the public key corresponding to a private key.
  - `ssh user@remote-vm`: Connect to a remote VM using SSH.
  - `ssh-keygen -p`: Change the passphrase of a private key file.
  - `ssh-agent`: SSH agent is a program that runs in the background and holds your private keys.
  - `ssh-add`: Add private key identities to the authentication agent.

- **Permissions and Errors**
  - "Permission denied (publickey)": Error indicating issues with SSH key permissions or authentication.
  - "WARNING: REMOTE HOST IDENTIFICATION HAS CHANGED!": Error indicating a change in the remote host's SSH key.

#### 3. **Regular Expressions**
- **Pattern Matching**
  - `"email": v([^u]+)`: Regular expression to match email patterns.
  - `10\\.[0-9]\\{1,3\\}\\.[0-9]\\{1,3\\}\\.[0-9]\\{1,3\\}\\.[0-9]\\{1,3\\}`: Regular expression to match Class A private IP addresses.
  - `192\\.168\\.[0-9]\\{1,3\\}\\.[0-9]\\{1,3\\}`: Regular expression to match Class C private IP addresses.

#### 4. **Process Management**
- **Background Processes**
  - `command & echo $!`: Run a command in the background and display its process ID (PID).
  - `command > output.txt 2>&1`: Redirect stdout and stderr to a file.
  - `command &> output.txt`: Redirect stdout and stderr to a file.

#### 5. **IP Addresses**
- **IPv4 Addresses**
  - **Class A**: 10.0.0.0 to 10.255.255.255
  - **Class B**: 172.16.0.0 to 172.31.255.255
  - **Class C**: 192.168.0.0 to 192.168.255.255

